    public String longestDupSubstring(String s) {
        final Map<String, List<String>> subStringMap = new HashMap<>();
        final int lenght = s.length();
        int l = lenght - 1;
        int top = l;
        while (l > 0) {
            subStringMap.clear();
            for (int i = 0; i + l <= s.length(); i++) {
                final String subStr = s.substring(i, i + l);
                if (subStringMap.containsKey(subStr)) {
                    final List<String> itemList = subStringMap.get(subStr);
                    for (String item : itemList) {
                        if (item.equals(subStr)) {
                            return subStr;
                        }
                    }
                    itemList.add(subStr);
                } else {
                    final List<String> itemList = new ArrayList<>();
                    itemList.add(subStr);
                    subStringMap.put(subStr, itemList);
                }
            }
            l = l / 2;
        }
        return "";
    }
